        var rand = min + Math.random() * (max - min + 1);
        rand = Math.floor(rand);
        return rand;
    }

    constructor({ name = '', rating = 0, guess = Psychic.guessesFunc }) {
        this.id = Psychic.id();
        this.name = name;
        this.rating = rating;
        this.guess = guess;
    }

    ratingIncrement() {
        this.rating += 1;
    }

    ratingDecrease() {
        this.rating -= 1;
        if (this.rating < 0) {
            this.rating = 0;
        }
    }

    valueOf() {
        return {
            'name': this.name,
            'rating': this.rating,
        };
    }
}

