    recalcRating(answer, guesses) {
        const winIndex = guesses.indexOf(Number(answer));
        this.psychics.forEach((ps, index) => {
            if (winIndex === index) {
                ps.ratingIncrement();
            } else {
                ps.ratingDecrease();
            }
        });
    }
}

